import React from 'react';


const Cart = ({ product }) => {
    return (
        <div className="container">

            <table className="table table-striped ">
                <thead>
                    <tr>
                        <th scope="col">Title</th>
                        <th scope="col">Price</th>
                        <th scope="col">Descriptions</th>
                        <th scope="col">Image</th>
                    </tr>
                </thead>
                
            </table>
        </div>
    );
}

export default Cart;
